import React from 'react';
import './styles/Game.css';

const Game = () => {
    return(
        <div className='Game'>
            <div className='players-city'></div>
            <div>2</div>
            <div className='cross-roat'>перекресток</div>
            <div>3</div>
            <div>4</div>
        </div>
    )
}

export default Game;
